import React from "react";

function Navbar() {

// scroll functionality in the home page

  const scrollToMessages = () => {
    const moreSection = document.getElementById('messages');
    if (moreSection) {
      moreSection.scrollIntoView({ behavior: 'smooth', block: 'start' });
    }
  }

  const scrollToMore = () => {
    const moreSection = document.getElementById('more');
    if (moreSection) {
      moreSection.scrollIntoView({ behavior: 'smooth', block: 'start' });
    }
  }

  const scrollToActivities = () => {
    const moreSection = document.getElementById('activities');
    if (moreSection) {
      moreSection.scrollIntoView({ behavior: 'smooth', block: 'start' });
    }
  }

  const scrollToLocation = () => {
    const moreSection = document.getElementById('loc');
    if (moreSection) {
      moreSection.scrollIntoView({ behavior: 'smooth', block: 'start' });
    }
  }



function handleHome(){
  const elements = document.getElementsByClassName("home");
   elements[0].style.display="block";
}

function handleHome2(){
  const elements = document.getElementsByClassName("home");
   elements[0].style.display="none";
}

function handleAbout(){
  const elements = document.getElementsByClassName("about");
  elements[0].style.display="block";
}

function handleAbout2(){
  const elements = document.getElementsByClassName("about");
  elements[0].style.display="none";
}

function handleAdmission(){
  const elements = document.getElementsByClassName("admission");
  elements[0].style.display="block";
}

function handleAdmission2(){
  const elements = document.getElementsByClassName("admission");
  elements[0].style.display="none";
}

function handleLearning(){
  const elements = document.getElementsByClassName("learning");
  elements[0].style.display="block";
}

function handleLearning2(){
  const elements = document.getElementsByClassName("learning");
  elements[0].style.display="none";
}

function handleCampus(){
  const elements = document.getElementsByClassName("campus");
  elements[0].style.display="block";
}

function handleCampus2(){
  const elements = document.getElementsByClassName("campus");
  elements[0].style.display="none";
}

function handleContact(){
  const elements = document.getElementsByClassName("contact");
  elements[0].style.display="block";
}

function handleContact2(){
  const elements = document.getElementsByClassName("contact");
  elements[0].style.display="none";
}



    return (
      <div >
        <div className="navbar">
        <img src="/icons/nps_logo2.jpg"  alt="Logo"/>
          <ul>
            <li onMouseEnter={handleHome} onMouseLeave={handleHome2}><a href="/">Home</a>
            <ul className="home">
              <li onClick={scrollToMessages}><a href="/"></a>Messages</li>
              <li  onClick={scrollToMore}>More</li>
              <li  onClick={scrollToActivities}>Events & Activities</li>
              <li  onClick={scrollToLocation}>Location</li>
            </ul>
            </li>
            <li onMouseEnter={handleAbout} onMouseLeave={handleAbout2}><a href="/about">About Us</a>
            <ul className="about">
              <li>History</li>
              <li>NPS Shivapura </li>
              <li>School Profile</li>
            </ul>
            </li>
            <li onMouseEnter={handleAdmission} onMouseLeave={handleAdmission2}><a href="/admissions">Admissions</a>
            <ul className="admission">
              <li>Welcome.</li>
              <li>Registration</li>
            </ul>
            </li>
            <li onMouseEnter={handleLearning} onMouseLeave={handleLearning2}><a href="/learning">Learning</a>
            <ul className="learning">
              <li>Programmes</li>
              <li>Orientations</li>
              <li>Advancements</li>
              <li>Competitions</li>
              <li>Events & Celebrations</li>
            </ul>
            </li>
            <li onMouseEnter={handleCampus} onMouseLeave={handleCampus2}><a href="/campus">Our Campus</a>
            <ul className="campus">
              <li>Class Rooms</li>
              <li>Computer Lab</li>
              <li>Math Lab</li>
              <li>Library</li>
              <li>AV Room</li>
              <li>Portable Water</li>
              <li>CCTV</li>
              <li>Additional Facilities</li>
            </ul>
            </li>
            <li onMouseEnter={handleContact} onMouseLeave={handleContact2}><a href="/contact">Contact Us</a>
            <ul className="contact">
              <li>Address</li>
              <li>Telephone No.</li>
              <li>E-mail Address</li>
            </ul>
            </li>
          </ul>
        </div>
      </div>
    );
  }

export default Navbar;
